import { useState } from 'react';

function App() {
  const [todo, setTodo] = useState('');
  const onChangeHandler = (e) => setTodo(e.target.value);
  const onSubmit = (e) => e.preventDefault();

  return (
    <div>
      <form onSubmit={onSubmit}>
        <input value={todo} onChange={onChangeHandler} />
      </form>
    </div>
  );
}

export default App;
